import pytest
import base64
import io


from app.pirates_captcha.ikapiratesdecaptcha import get_captcha_string

qxqhfrv = ''
k4plb57a = ''

def from_base64(base64string):    
    return io.BytesIO(base64.b64decode(base64string))

def test_image_k4plb57a():
    image = from_base64(k4plb57a)
    result = get_captcha_string(image)
    assert result.lower() == 'k4plb57a', f'Expected k4plb57a, got {result}'
    
def test_image_qxqhfrv():
    image = from_base64(qxqhfrv)
    result = get_captcha_string(image)
    assert result.lower() == 'qxqhfrv', f'Expected qxqhfrv, got {result}'